import { Text,Box } from"native-base"
 const Post = ({item})=>{
    
        return (
          <Box>
          <HStack style={{justifyContent:'space-between',margin:5}}>
              <VStack>
                  <Text>
                  <Text style={{fontWeight:'bold'}}>
                          
                          Title:
                          </Text>
                      {item.title}
                  </Text>
                    <Text>
                        <Text style={{fontWeight:'bold'}}>
                            
                            Email:
                            </Text>
                        {item.email}
                    </Text>
                </VStack>
                <ArrowForwardIcon onPress={()=>{
                    navigation.navigate({name:'details',params:{
                        id:item.id
                    }})
                }}/>
            </HStack>
        </Box>)
    
    
}
export default Post;
